[{"operationName":"GuidedCourseWeekQuery","variables":{"ids":"20430477~HnfPZCR1EeWDEQ4YpP0FCQ"},"query":"query GuidedCourseWeekQuery($ids: [String!]!) {
  GuidedCourseWeekCardsV1Resource {
    multiGet(ids: $ids) {
      elements {
        id
        weeks {
          weekStatus
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}]
